import React from 'react';
import './App.css';
import './Hello.css';

function From() {
  function add() {
    <input type="text" name="jhg" id="name"></input>;
    <input type="text" name="jkh" id="Familyname"></input>;
  }

  return <div className="HelloBox">Name '' Familyname</div>;
}

export default From;
